#!/usr/bin/envkotlin kotlin

import java.util.*
import java.lang.StringBuilder

// Given a word, write a function to generate all of its unique generalized abbreviations.
// Generalized abbreviation of a word can be generated by replacing each substring of the word
// by the count of characters in the substring. Take the example of “ab” which has four substrings:
// "", "a", "b", and "ab". After replacing these substrings in the actual word by the count of
// characters we get all the generalized abbreviations: "ab", "1b", "a1", and "2".
fun main() {

    /**
     *              BAT
     *     1         2          3
     *    1AT       B1T        BA1
     *  2T  1A1    B2
     *  3
     *
     *  Replace each letter with number 1 from left to right
     *  Then always replace from left to right but join all numbers to left
     */
    fun generateGeneralizedAbbreviation(word: String): List<String> {
        val result = arrayListOf<String>()

        fun dfs(startIdx: Int, curr: StringBuilder) {
            result.add(curr.toString())
            if (startIdx == word.length || curr.toString().toIntOrNull() != null) return

            for (i in startIdx..curr.lastIndex) {
                val currCopy = StringBuilder(curr)
                if (!currCopy[i].isDigit()) {
                    currCopy[i] = '1'
                }

                var collapseNumbersIdx = i - 1
                var newStartIdx =  i + 1

                if (collapseNumbersIdx >= 0 && currCopy[collapseNumbersIdx].isDigit()) {
                    var prevNumberAsString = Character.getNumericValue(currCopy[collapseNumbersIdx]).toString()
                    var toDeleteCount = 1

                    while (collapseNumbersIdx - 1 >= 0 && currCopy[collapseNumbersIdx - 1].isDigit()) {
                        collapseNumbersIdx--
                        toDeleteCount++
                        prevNumberAsString = currCopy[collapseNumbersIdx] + prevNumberAsString
                    }

                    val count = prevNumberAsString.toInt() + 1
                    val digitsToAdd = count.toString().toCharArray()
                    currCopy.delete(collapseNumbersIdx, collapseNumbersIdx + toDeleteCount + 1)
                    currCopy.insert(collapseNumbersIdx, digitsToAdd)

                    newStartIdx = i + digitsToAdd.size - toDeleteCount
                }

                dfs(newStartIdx, currCopy)
            }
        }

        dfs(0, StringBuilder(word))
        return result
    }

    val testCase = { actual: List<String>, expected: List<String> ->
        println(actual.containsAll(expected) && actual.size == expected.size)
    }

    testCase(
        generateGeneralizedAbbreviation("BAT"),
        listOf("BAT", "1AT", "2T", "3", "1A1", "B1T", "B2", "BA1")
    )

